INSERT INTO `fy_resource_comment` (`id`, `rid`, `message`, `summary`, `url`, `author`, `avatar`, `create_time`, `update_time`) VALUES
(1, 1, '<div style="text-align: center;">\r\n<div><span style="font-size:18px;">宫里的世界免费抽奖活动规则</span></div>\r\n\r\n<div style="text-align: left;"><span style="font-size:16px;">1. 用户均可免费申请参与活动<br />\r\n2. 需要邀请5位好友助力，协助参与活动<br />\r\n3. 活动结束后，会发出服务通知，告知用户是否中奖<br />\r\n4. 宫里的世界的所有产品均为故宫文化珠宝和合作品牌直接提供，杜绝一切非正规渠道的产品，请用户放心领用<br />\r\n5. 最终解释权归宫里的世界所有</span></div>\r\n</div>\r\n<br />\r\n&nbsp;', '冻干银耳汤限时38.8元，活动时间：7月3日-7月5日。', '', '', '', '2018-07-04 15:11:41', '2018-07-04 15:11:41'),
(2, 2, '<div><img src="https://gggtwh.oss-cn-beijing.aliyuncs.com/2018/07/q6czgu7LYOafjRp9ysFrxZK31wn0I4Ai.png" style="height:375px; width:282.66331658291455px" /></div>\r\n', NULL, '', '', '', '2018-07-04 16:33:43', '2018-07-04 16:33:43'),
(3, 162, '<p>在忙忙碌碌的城市中待久了，想不想体验热烈的阳光，在高耸入云的丛林植物间听猿猴啼鸣？我们新上线的亚马逊雨林物语系列，就想带你开启这样一段亚马逊热带雨林探秘之旅。<br />\r\n<br />\r\n在设计之初，我们的设计师小甜参考了卢梭的热带丛林画作和《疯狂原始人》的电影画面，想为大家呈现一个充满神秘与野性的亚马逊丛林世界。她手绘了热带植物悬铃花、天堂鸟、朱瑾、龟背竹、鸡蛋花和巨嘴鸟、猴子、猩猩，让动物们掩映在自由生长的丛林之间，仿佛正等着你去找寻它们的足迹。<br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<div><img src="https://wxappres.feeyan.com/mp/d6mBDb2J9fvT43XiKRhUu8toageH7cwS/2018/07/FGATICye467pKYiEXZhPVqUw95mMsnSQ.jpeg" style="height:300px; width:590px" /></div>\r\n\r\n<p><br />\r\n这些可爱的动植物们在马克杯、玻璃杯、随手杯之间跳跃着，它们先来到使用古代官窑技艺烧制的马克杯，然后又跃上食品级材质制成的随手杯中，最后跳去由耐热防爆的高硼硅玻璃制成的玻璃杯，在透明纯净的杯中舒适的找到属于自己的位置。<br />\r\n<br />\r\n河马先生和它们可不太一样，它是一个金属制的盖纽，憨态可掬的待在杯盖上，仿佛正从河水中悄悄冒出头来，不小心却荡出了杯盖上一圈圈的水波涟漪。它在马克杯中的地位也甚是重要，以前大家总是希望我们能推出带有杯盖的马克杯，这次由小河马点缀的瓷面杯盖就承担了防尘保温的功能。<br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<div><img src="https://wxappres.feeyan.com/mp/d6mBDb2J9fvT43XiKRhUu8toageH7cwS/2018/07/BmMh0luPZefkA325aVC4JNQpowLtKnGX.jpg" style="height:600px; width:600px" /><br />\r\n<br />\r\n后续动植物们还会去到更有趣的地方，还有更多让人惊喜的设计杯型上线，大家敬请期待吧。</div>\r\n', NULL, '', '', '', '2018-07-04 19:33:53', '2018-07-04 19:33:53');
