(181, 185, 0, '7月1日到7月31日，在故宫博物院紫禁书院，一场传承和展现东方文化美学的视觉盛宴将等待您的到来，届时，现场将展出故宫博物院文保科技部漆器修复师闵俊嵘的多件古琴作品，以及奈莎珠宝的三十余件东方艺术珠宝作品。此次展出，以东方文化为底蕴，以古琴和珠宝为主题，将完美的诠释东方美学。', '["https:\\/\\/gggtwh.oss-cn-beijing.aliyuncs.com\\/2018\\/07\\/SJc7O2Nswx3GnQ8qyB1PIfilWvdM4UDb.jpg"]', '[]', '20.00', '2018-07-13 03:13:50', '2018-07-13 03:13:50', '["https:\\/\\/gggtwh.oss-cn-beijing.aliyuncs.com\\/2018\\/07\\/Ywq5z1cbS8LDv23HugEmKVyjIFB7AaN4.jpg"]'),
