(224, 228, 0, '<div>采用江崖海水纹路作为设计纹样，设计了这款烫金、烫银的纸胶带，可用于贴口红，贴手账，贴办公用品&hellip;无数种新玩法等你探索。<br />\r\n<img src="https://gggtwh.oss-cn-beijing.aliyuncs.com/2018/07/CjU6JsThWRI5XdltvYAGfa3Sib8qFrZg.jpg" style="height:375px; width:375px" /></div>\r\n<br />\r\n&nbsp;', '["https:\\/\\/gggtwh.oss-cn-beijing.aliyuncs.com\\/2018\\/07\\/OQtvH4wLeA2NBsVJFjzu6GycCrTolYZk.jpg"]', '[]', '15.00', '2018-07-18 17:35:13', '2018-07-18 17:35:13', '["https:\\/\\/gggtwh.oss-cn-beijing.aliyuncs.com\\/2018\\/07\\/lji72UswFQTdLGuEAWKvVa63ncC0zeZm.jpg"]'),
(225, 229, 0, '<p>你是否中了这款保温杯的圈套？</p>\r\n\r\n<p>人潮人海中，又看到你，保温杯泡着枸杞&middot;&middot;&middot;&middot;&middot;&middot;</p>\r\n\r\n<p>一张黑豹乐队鼓手赵明义端着保温杯的照片让保温杯被调侃成&quot;人到中年&quot;的标配，那么保温杯真的是中年的标配吗 ？</p>\r\n\r\n<p>其实事实不是这样子的，反观周围的上班白领，当今时尚潮流圈，保温杯竟成为了最流行的标配，许多人都有走到哪保温杯带到哪的习惯。保温杯成了专属挚友，见面问候一声&quot;天气转凉，喝杯热水压压惊可好&quot;，显得格外亲切。&nbsp;</p>\r\n\r\n<p>从2000年前的春秋战国时期的鉴缶，到南宋画家刘松年名作《茗苑赌市图》中描绘，再到清宫收藏的&quot;银烧蓝暖酒壶&quot;，保温杯在中国可谓是历史悠久。直到1982年苏格兰的化学家詹姆斯-杜瓦开发了沿用至今的经典保温杯形象，1903年被德国的赖因-伯格应用到生活中成为了&quot;膳魔师&quot;，保温杯才是真正意义上衔接了中西方文化的交织。</p>\r\n\r\n<p><img _src="https://img.yzcdn.cn/upload_files/2017/11/09/Frvzz5KdNhmhQDv_NR3oG4985pnA.png!730x0.jpg" data-origin-height="458" data-origin-width="368" src="https://img.yzcdn.cn/upload_files/2017/11/09/Frvzz5KdNhmhQDv_NR3oG4985pnA.png!730x0.jpg" /><img _src="https://img.yzcdn.cn/upload_files/2017/11/09/FtlnTOuIhkdkcknUGIjq5K5haWUJ.png!730x0.jpg" data-origin-height="290" data-origin-width="369" src="https://img.yzcdn.cn/upload_files/2017/11/09/FtlnTOuIhkdkcknUGIjq5K5haWUJ.png!730x0.jpg" />银烧蓝暖酒壶</p>\r\n\r\n<p>如今，放眼万千世界，保温杯的品类也是层出不穷，百花齐放。</p>\r\n\r\n<p>但是，只有这款保温杯，才真正又一次衔接了传统中国宫廷文化和西方潮流的交织，</p>\r\n\r\n<p>这就是故宫文化珠宝（北京故宫宫廷公司）全新推出的&quot;灵犬戏芙蓉&quot;保温杯。</p>\r\n\r\n<p><img _src="https://img.yzcdn.cn/upload_files/2017/11/09/FvQHWqkiDfCEPOtEqNuC_Jrtt6VC.jpg!730x0.jpg" data-origin-height="2000" data-origin-width="1334" src="https://img.yzcdn.cn/upload_files/2017/11/09/FvQHWqkiDfCEPOtEqNuC_Jrtt6VC.jpg!730x0.jpg" /></p>\r\n\r\n<p>&quot;灵犬戏芙蓉&quot;不锈钢真空保温茶滤杯</p>\r\n\r\n<p>高198mm</p>\r\n\r\n<p>直径65mm</p>\r\n\r\n<p>哑光蓝、哑光粉</p>\r\n\r\n<p>价格：&yen;228</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>这是一款有身份的保温杯</p>\r\n\r\n<p><img _src="https://img.yzcdn.cn/upload_files/2017/11/09/FnD0pUrERMrvqbpSHnJe89Zd0N4I.jpg!730x0.jpg" data-origin-height="2000" data-origin-width="1333" src="https://img.yzcdn.cn/upload_files/2017/11/09/FnD0pUrERMrvqbpSHnJe89Zd0N4I.jpg!730x0.jpg" /></p>\r\n\r\n<p>这款&quot;灵犬戏芙蓉&quot;保温杯的设计灵感取材于故宫博物院藏文物《艾启蒙十骏犬图册》中的&quot;细犬&quot;和《十二花神杯》中的&quot;芙蓉花&quot;进行组合和再设计，并将宫廷中象征皇权至高无上的金色和时尚贵气的蓝、粉色进行碰撞。被誉为国内设计圈的&quot;印花女王&quot;的设计师刘清扬此次更以偏古典的原创风格来绘制灵犬与芙蓉花的组合，这种方式也是明清宫廷工笔绘画中常见的形式。以西方印花的设计手法再现古今交织的画作，雍容典雅中尽显灵气逼人。</p>\r\n\r\n<p><img _src="https://img.yzcdn.cn/upload_files/2017/11/09/Fqt_NgZmsKIb6hPraKriKQocnCgg.png!730x0.jpg" data-origin-height="436" data-origin-width="834" src="https://img.yzcdn.cn/upload_files/2017/11/09/Fqt_NgZmsKIb6hPraKriKQocnCgg.png!730x0.jpg" /></p>\r\n\r\n<p><img _src="https://img.yzcdn.cn/upload_files/2017/11/09/Fs-reDIqk6i8zmoOTnDP2Rtto7wB.png!730x0.jpg" data-origin-height="442" data-origin-width="834" src="https://img.yzcdn.cn/upload_files/2017/11/09/Fs-reDIqk6i8zmoOTnDP2Rtto7wB.png!730x0.jpg" /></p>\r\n\r\n<p>艾启蒙十骏犬图册</p>\r\n\r\n<p><img _src="https://img.yzcdn.cn/upload_files/2017/11/09/Fk3iOhWRwXvuSIuLgZcjq58C1E83.png!730x0.jpg" data-origin-height="252" data-origin-width="327" src="https://img.yzcdn.cn/upload_files/2017/11/09/Fk3iOhWRwXvuSIuLgZcjq58C1E83.png!730x0.jpg" /></p>\r\n\r\n<p>《十二花神杯》&quot;芙蓉花&quot;图</p>\r\n\r\n<p>灵犬生性机智敏捷，有忠心护主之义，在2018生肖狗年到来之际，以灵犬报兴旺，以瑞兽祝昌隆。</p>\r\n\r\n<p>&quot;千林扫作一番黄，只有芙蓉独自芳&quot;，在这个冬日，以芙蓉霜侵露凌却丰姿艳丽，占尽深秋风情的姿态，以百花凋谢之际傲霜绽放的独特与执着，展示一份最独特的性格。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>这是一款标新立异的保温杯</p>\r\n\r\n<p><img _src="https://img.yzcdn.cn/upload_files/2017/11/09/FhHQPjLv0hcREnatHPuhP5ETQdcl.jpg!730x0.jpg" data-origin-height="1333" data-origin-width="2000" src="https://img.yzcdn.cn/upload_files/2017/11/09/FhHQPjLv0hcREnatHPuhP5ETQdcl.jpg!730x0.jpg" /></p>\r\n\r\n<p>圣诞季来临，市场上清一色的红色保温杯，虽然我们也有享誉海内外的故宫红，但此次我们标新立异推出了很小清新的&quot;粉色&quot;与&quot;蓝色&quot;系列，从康熙的&quot;粉色实地纱地绣花卉蝶纹褶子&quot;，到雍正的&quot;画珐琅花卉寿字纹盏&quot;和&quot;淡粉釉瓶&quot;，再到嘉庆的&quot;粉彩鼻烟壶&quot;，这些故宫博物院藏文物中，我们也发现而这个色系也是清宫后妃与格格们最喜爱的颜色，充满了年轻，充满了淡雅，不失品质，更不失贵气。</p>\r\n\r\n<p><img _src="https://img.yzcdn.cn/upload_files/2017/11/09/FiijzVfD3nzM9RTeh_WfnHC_cqh2.png!730x0.jpg" data-origin-height="319" data-origin-width="413" src="https://img.yzcdn.cn/upload_files/2017/11/09/FiijzVfD3nzM9RTeh_WfnHC_cqh2.png!730x0.jpg" /></p>\r\n\r\n<p>&nbsp; &nbsp;【粉色实地纱地绣花卉蝶纹褶子】</p>\r\n\r\n<p><img _src="https://img.yzcdn.cn/upload_files/2017/11/09/Fox-j6Fk45uo2CGSL63UjCN7einf.png!730x0.jpg" data-origin-height="410" data-origin-width="314" src="https://img.yzcdn.cn/upload_files/2017/11/09/Fox-j6Fk45uo2CGSL63UjCN7einf.png!730x0.jpg" /></p>\r\n\r\n<p>淡粉釉瓶</p>\r\n\r\n<p><img _src="https://img.yzcdn.cn/upload_files/2017/11/09/FkTiYuKg27IpGQBYs9uXquZm9mFy.png!730x0.jpg" data-origin-height="328" data-origin-width="413" src="https://img.yzcdn.cn/upload_files/2017/11/09/FkTiYuKg27IpGQBYs9uXquZm9mFy.png!730x0.jpg" /></p>\r\n\r\n<p>画珐琅花卉寿字纹盏</p>\r\n\r\n<p><img _src="https://img.yzcdn.cn/upload_files/2017/11/09/FuPvARamBxB3iB7kfX04xJ8dCSFh.png!730x0.jpg" data-origin-height="520" data-origin-width="409" src="https://img.yzcdn.cn/upload_files/2017/11/09/FuPvARamBxB3iB7kfX04xJ8dCSFh.png!730x0.jpg" /></p>\r\n\r\n<p>粉彩鼻烟壶，清嘉庆&nbsp;</p>\r\n\r\n<p>而这款保温杯的包装便采用了最著名的故宫红和福筒的设计，盒上盖有闲章&quot;故宫印记&quot;。</p>\r\n\r\n<p>当你在圣诞或新年礼物间存在选择困难症的时候，这当真无愧时最好的年末伴手礼。</p>\r\n\r\n<p><img _src="https://img.yzcdn.cn/upload_files/2017/11/09/FqcX2jZOlq2IoZhwidOZsEnQ03Yq.jpg!730x0.jpg" data-origin-height="2000" data-origin-width="1333" src="https://img.yzcdn.cn/upload_files/2017/11/09/FqcX2jZOlq2IoZhwidOZsEnQ03Yq.jpg!730x0.jpg" /></p>\r\n\r\n<p>这是一款工艺bling bling，自带暖男属性的保温杯</p>\r\n\r\n<p><img _src="https://img.yzcdn.cn/upload_files/2017/11/09/Fl3xpKFxYzqSD-ejQ8YPa68YHZx5.jpg!730x0.jpg" data-origin-height="2000" data-origin-width="1333" src="https://img.yzcdn.cn/upload_files/2017/11/09/Fl3xpKFxYzqSD-ejQ8YPa68YHZx5.jpg!730x0.jpg" /></p>\r\n\r\n<p>阳光暖男系，是乐于将温暖分享给每一双手，即使有时候表面冰冷，但是内心却是无比温暖</p>\r\n\r\n<p>而这款&quot;灵犬戏芙蓉&quot;保温杯，便自带暖男属性。</p>\r\n\r\n<p>轻柔的重量如意成美梦，即使装满也不会感到厚重，不锈钢真空结构，100%密封防漏杯盖，保温保冷达6小时（95摄氏度至60摄氏度），让这款杯子在轻盈的同时也有着良好的保温性。无尾真空技术的应用让整体外观更加美观舒适，大容量和符合人体工程学的饮口设计，不仅可作为茶滤，让你饮用舒适，避免烫伤；垂直杯身设计，轻巧随行，舒适握感，就像握住着一种稳稳的幸福感。</p>\r\n\r\n<p><img _src="https://img.yzcdn.cn/upload_files/2017/11/09/Fl9yZ3snzxmRe8yLjIfnt3U_TiRh.jpg!730x0.jpg" data-origin-height="2000" data-origin-width="1334" src="https://img.yzcdn.cn/upload_files/2017/11/09/Fl9yZ3snzxmRe8yLjIfnt3U_TiRh.jpg!730x0.jpg" /></p>\r\n\r\n<p>此次&quot;灵犬戏芙蓉&quot;保温杯是由曾今荣获红点奖的奔迈MIGO来制作，更是经过多次物理和化学测试确保各个性能的高标准，给足了你安全感。</p>\r\n\r\n<p>这么一款极具颜值，极具安全感和暖男属性的保温杯，你的目光怎能不为他停留呢？更何况这位&quot;暖男&quot;用行动去诉说最美却最接地气的情话：多喝热水。</p>\r\n\r\n<p>这是一款最有温度的保温杯</p>\r\n\r\n<p><img _src="https://img.yzcdn.cn/upload_files/2017/11/09/FodDM42W7FgGNhzLcWjtLgznpAZz.jpg!730x0.jpg" data-origin-height="1333" data-origin-width="2000" src="https://img.yzcdn.cn/upload_files/2017/11/09/FodDM42W7FgGNhzLcWjtLgznpAZz.jpg!730x0.jpg" /></p>\r\n\r\n<p>英国一个14岁的自闭症孩童，只用父亲送给自己的蓝色水杯喝水，当这个杯子无法在使用后，男孩看居然卡是拒绝喝水，然而这个水杯已经停产了13年。男孩的父亲通过互联网求助，工厂为这个自闭症孩子重新打开停止已久的生产线，为其免费生产了1000个杯子供他使用，而这1000个杯子，成为了这对父子最惊喜的圣诞节礼物。</p>\r\n\r\n<p>在这个自闭症孩子的眼中，水杯是他最好的甚至是唯一的朋友，对于我们来说，都有一个握在手心里温暖无比、无可取代的杯子。</p>\r\n\r\n<p>早出晚归成为了都市生活忙碌的标志，咖啡厅里不再是怡情享受而充满创业项目和融资的高谈阔论，顾不上的午饭，等不及烧开的热水，翻屋现在烧水饮茶都成为了奢侈和时间的浪费，爱惜自己也成为了最奢侈的企及。何不携一个灵犬戏弄芙蓉保温杯，在清晨迷糊时一杯咖啡，在忙碌的工作中携带一杯调理血气，安神降燥的玫瑰花茶；在年底熬夜做方案预算时喝上一杯清肝明目补元气的花旗参泡枸杞，在失眠的夜晚泡上一杯薰衣草茶。比起西红柿炒鸡蛋，在如此天冷胃寒时为父母泡上一杯红枣姜茶更加温暖。&nbsp;</p>\r\n\r\n<p>这是一款自带热搜属性的保温杯</p>\r\n\r\n<p><img _src="https://img.yzcdn.cn/upload_files/2017/11/09/FlhqTq-doj5EtjNI5jLkpU0w25Al.jpg!730x0.jpg" data-origin-height="1333" data-origin-width="2000" src="https://img.yzcdn.cn/upload_files/2017/11/09/FlhqTq-doj5EtjNI5jLkpU0w25Al.jpg!730x0.jpg" /></p>\r\n\r\n<p>你可能赶上了&quot;中年标配&quot;的热闹，但不得不承认保温杯的时尚icon程度盖过了freestyle，</p>\r\n\r\n<p>你可能见过很多明星采访，但你不得不承认当他拿着保温杯时焦点就对准了它，</p>\r\n\r\n<p>你可能喝惯了瓶装水，但我建议你还是为环保打call</p>\r\n\r\n<p>你可能不喝热水，但保温杯确实实用，</p>\r\n\r\n<p>你可能见过很多品类的保温杯，可你绝对不想要错过这一款&quot;灵犬戏芙蓉&quot;。</p>\r\n\r\n<p><strong><img _src="https://img.yzcdn.cn/upload_files/2017/02/15/FjDqRNdk1ldhrCJwmZ_2dXTkVtly.jpg!730x0.jpg" alt="" data-origin-height="160" data-origin-width="640" src="https://img.yzcdn.cn/upload_files/2017/02/15/FjDqRNdk1ldhrCJwmZ_2dXTkVtly.jpg!730x0.jpg" /></strong></p>\r\n\r\n<p><strong>商家承诺以下服务：&nbsp;&nbsp; &nbsp;</strong>&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>1、除港澳台、新疆西藏等偏远地外，其余地区默认韵达,圆通；</p>\r\n\r\n<p>2、下单后三个工作日内发货。</p>\r\n\r\n<p>3、商品本身无质量问题暂不支持7天无理由退换货。</p>\r\n', '["https:\\/\\/gggtwh.oss-cn-beijing.aliyuncs.com\\/2018\\/07\\/9NSZ2ku6dsFf7BLCqitHMDxA1ravcepw.jpg"]', '[]', '15.00', '2018-07-18 17:43:39', '2018-07-18 17:43:39', '["https:\\/\\/gggtwh.oss-cn-beijing.aliyuncs.com\\/2018\\/07\\/R98CYeGocFiJylE1saS0tgrMAzTNpb4q.jpg"]'),
(226, 230, 0, '334', '["https:\\/\\/gggtwh.oss-cn-beijing.aliyuncs.com\\/2018\\/07\\/eD60mNbLfyxXIPOgtYa2oUd19KVHAncZ.jpg"]', '[]', '33.00', '2018-07-18 19:02:53', '2018-07-18 19:02:53', 'null'),
(227, 231, 0, '<div><img src="https://gggtwh.oss-cn-beijing.aliyuncs.com/2018/07/n5Gt6Vdrm0PODXbZzUs8jBJF3kHTKaef.jpg" style="height:249.609375px; width:375px" /></div>\r\n&nbsp;\r\n\r\n<div><img src="https://gggtwh.oss-cn-beijing.aliyuncs.com/2018/07/5FawH0pZbhQelTjRnGiB2UrAENkc17fo.jpg" style="height:249.609375px; width:375px" /></div>\r\n&nbsp;\r\n\r\n<div><img src="https://gggtwh.oss-cn-beijing.aliyuncs.com/2018/07/mu5TNdZsKFCeobVajvrwW9k01ntJHM4D.jpg" style="height:249.609375px; width:375px" /></div>\r\n&nbsp;\r\n\r\n<div><img src="https://gggtwh.oss-cn-beijing.aliyuncs.com/2018/07/qmIapMiNfd7kQS2jy5ZXBUAergznbDvV.jpg" style="height:249.609375px; width:375px" /></div>\r\n<br />\r\n&nbsp;', '["https:\\/\\/gggtwh.oss-cn-beijing.aliyuncs.com\\/2018\\/07\\/FUDjKwsh4IPSzxuYM5OlBNHQ3r0kAeVn.jpg","https:\\/\\/gggtwh.oss-cn-beijing.aliyuncs.com\\/2018\\/07\\/Bav1WxuwS2LFOZdI67MqnDlTQp05jNec.jpg","https:\\/\\/gggtwh.oss-cn-beijing.aliyuncs.com\\/2018\\/07\\/378JuisDzZf09Wxo5MOXNEdBYLPbHRcp.jpg","https:\\/\\/gggtwh.oss-cn-beijing.aliyuncs.com\\/2018\\/07\\/jqMB8RpQITJiLHrG3sVPuZSxwnCeK9gb.jpg"]', '[{"name":"规格","list":["男款","女款"]}]', '15.00', '2018-07-18 19:51:58', '2018-07-18 19:51:58', 'null');
INSERT INTO `fy_resource_product` (`id`, `rid`, `sort`, `description`, `pic`, `sku`, `shipprice`, `create_time`, `update_time`, `ppic`) VALUES
(228, 232, 0, '<p>&ldquo;囍鹿衔芝&rdquo;系列，是由一条长链与一条Choker短链组成，相同主题下的设计元素使得两者相互呼应，增添了整套首饰完整性的同时，让古典与现代的美学碰撞给人以&ldquo;动静皆宜&rdquo;的美感。取&ldquo;鹿&rdquo;为&ldquo;禄&rdquo;寓意福禄双全；故宫&ldquo;囍&rdquo;寓意双喜和美；故宫团扇的抽象版演绎精巧细致，一株小巧玲珑的深蓝色灵芝取材于《故宫珐琅图典》中一款花瓶上灵芝图案，寓意吉祥如意。当传统文化遇上灵动画风，送上一份美好的祝愿。</p>\r\n\r\n<p><img _src="https://img.yzcdn.cn/upload_files/2017/05/31/Ft5Z8kDlpBOCqYEpHqMnpyzt-uKS.jpg!730x0.jpg" data-origin-height="667" data-origin-width="1000" src="https://img.yzcdn.cn/upload_files/2017/05/31/Ft5Z8kDlpBOCqYEpHqMnpyzt-uKS.jpg!730x0.jpg" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>囍鹿衔芝 产品描述</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>品名：囍鹿衔芝 项链系列</p>\r\n\r\n<p>材质：长项链铜镀18K金；Choker短链925银镀18K金；黑玛瑙</p>\r\n\r\n<p>内容：囍鹿衔芝系列长项链，囍鹿衔芝系列Choker短链</p>\r\n\r\n<p>尺寸：囍鹿衔芝系列长项链主链70cm，尾链30cm；囍鹿衔芝系列Choker短链39cm</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>产品欣赏</strong></p>\r\n\r\n<p><img _src="https://img.yzcdn.cn/upload_files/2017/05/31/FuEGbPZm46YQ6sCFvJIQ3h2wm0gh.jpg!730x0.jpg" data-origin-height="800" data-origin-width="533" src="https://img.yzcdn.cn/upload_files/2017/05/31/FuEGbPZm46YQ6sCFvJIQ3h2wm0gh.jpg!730x0.jpg" /></p>\r\n\r\n<p><img _src="https://img.yzcdn.cn/upload_files/2017/05/31/FtHAGfrvdBm2sY5lhLmZAKkcjAqH.jpeg!730x0.jpg" data-origin-height="1500" data-origin-width="1000" src="https://img.yzcdn.cn/upload_files/2017/05/31/FtHAGfrvdBm2sY5lhLmZAKkcjAqH.jpeg!730x0.jpg" /></p>\r\n\r\n<p>长链设计参考自清代皇帝御吉服所系腰带&ldquo;吉福带&rdquo;，这特别的形状与结构恰好将故宫中有趣的文化元素结合到一起，集结美好坠于胸前。选用特殊定制的镂空链条，以故宫文物中常见的&ldquo;鹿&rdquo;元素为主挂件，大胆选用时下最潮流的几何元素以硬朗的金属框架描绘出灵动摩登的小鹿形象，&ldquo;鹿&rdquo;&ldquo;禄&rdquo;同音，寓意福禄双全；故宫&ldquo;囍&rdquo;字挂件令整条项链更添古典韵味，寓意双喜和美；故宫团扇的抽象版演绎挂件以天然黑玛瑙镶嵌更是精巧细致，一株小巧玲珑的深蓝色灵芝挂件则成为点睛之笔，晶莹剔透的它取材于《故宫珐琅图典》中一款花瓶上描绘的灵芝图案，寓意吉祥如意，增添一点时髦。</p>\r\n\r\n<p><img _src="https://img.yzcdn.cn/upload_files/2017/06/01/FhfaWV-0M4HJbi3BNvcQG1V_Dbt-.jpg!730x0.jpg" data-origin-height="1000" data-origin-width="667" src="https://img.yzcdn.cn/upload_files/2017/06/01/FhfaWV-0M4HJbi3BNvcQG1V_Dbt-.jpg!730x0.jpg" /></p>\r\n\r\n<p><img _src="https://img.yzcdn.cn/upload_files/2017/05/31/Fmvtjl2SBmZr5KMI4QdFOb8_kC37.jpg!730x0.jpg" data-origin-height="800" data-origin-width="533" src="https://img.yzcdn.cn/upload_files/2017/05/31/Fmvtjl2SBmZr5KMI4QdFOb8_kC37.jpg!730x0.jpg" /></p>\r\n\r\n<p>长链后端的延长链约30cm，取材于朝服的一种佩挂物&ldquo;朝珠&rdquo;，链尾同样点缀&ldquo;囍&rdquo;字挂件，寓意从头到尾都美满喜乐。中间的黑玛瑙镶嵌不仅符合灵感源&ldquo;朝珠&rdquo;的原本结构，也平衡及丰富了背部设计的整体性。</p>\r\n\r\n<p><img _src="https://img.yzcdn.cn/upload_files/2017/05/31/Fo2PAfU2c4Um6m9YK0Z_odS_VHTn.jpg!730x0.jpg" data-origin-height="667" data-origin-width="1000" src="https://img.yzcdn.cn/upload_files/2017/05/31/Fo2PAfU2c4Um6m9YK0Z_odS_VHTn.jpg!730x0.jpg" /></p>\r\n\r\n<p><img _src="https://img.yzcdn.cn/upload_files/2017/05/31/FiO7fe7SVBBR6jV-hwoZ8LiLKz16.jpg!730x0.jpg" data-origin-height="800" data-origin-width="533" src="https://img.yzcdn.cn/upload_files/2017/05/31/FiO7fe7SVBBR6jV-hwoZ8LiLKz16.jpg!730x0.jpg" /></p>\r\n\r\n<p>相比于颠覆常规设计的长链，当下热门的首饰单品Choker短链则更加百搭，同样占据着视觉主体的&ldquo;鹿&rdquo;以天然黑玛瑙加以点缀，配以左右两侧颇具金属质感的&ldquo;囍&rdquo;字，在经光滑打磨的独特链条之上，既具备东方古典的对称美，精致细腻的制作工艺更令它成为摩登女孩们打造&ldquo;天鹅颈&rdquo;的必备神器。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>文物资料</strong></p>\r\n\r\n<p><img _src="https://img.yzcdn.cn/upload_files/2017/05/31/FgGSRmM5adZERypzjy4hAb-54Bo3.jpg!730x0.jpg" data-origin-height="800" data-origin-width="577" src="https://img.yzcdn.cn/upload_files/2017/05/31/FgGSRmM5adZERypzjy4hAb-54Bo3.jpg!730x0.jpg" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>图片资料来源于故宫博物院馆藏文物</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>设计师：</strong></p>\r\n\r\n<p><img _src="https://img.yzcdn.cn/upload_files/2017/05/31/FrPTh5J9VpQpxyqO8jetD3ncSVte.jpg!730x0.jpg" data-origin-height="357" data-origin-width="750" src="https://img.yzcdn.cn/upload_files/2017/05/31/FrPTh5J9VpQpxyqO8jetD3ncSVte.jpg!730x0.jpg" /></p>\r\n\r\n<p><strong><img _src="https://img.yzcdn.cn/upload_files/2017/02/15/FjDqRNdk1ldhrCJwmZ_2dXTkVtly.jpg!730x0.jpg" data-origin-height="160" data-origin-width="640" src="https://img.yzcdn.cn/upload_files/2017/02/15/FjDqRNdk1ldhrCJwmZ_2dXTkVtly.jpg!730x0.jpg" /></strong></p>\r\n\r\n<p><strong>商家承诺以下服务：&nbsp;&nbsp; &nbsp;</strong>&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>1、除港澳台、新疆西藏等偏远地外，其余地区默认韵达,圆通包邮；</p>\r\n\r\n<p>2、商品本身无质量问题暂不支持7天无理由退换货。</p>\r\n\r\n<p>&nbsp;</p>\r\n', '["https:\\/\\/gggtwh.oss-cn-beijing.aliyuncs.com\\/2018\\/07\\/2cFLnX15hgtYN43DBu0EzikR8bpIPVeC.jpg","https:\\/\\/gggtwh.oss-cn-beijing.aliyuncs.com\\/2018\\/07\\/aF6qDkMi8CcToXtydh4PjKGO3ZJ7EVvI.jpg","https:\\/\\/gggtwh.oss-cn-beijing.aliyuncs.com\\/2018\\/07\\/uoOGIN1bi5XL4FzEUf8ykK3MYnahZpQm.jpg"]', '[{"name":"规格","list":["囍鹿衔芝系列Choker短链"]}]', '15.00', '2018-07-18 20:04:41', '2018-07-18 20:04:41', 'null'),
(229, 233, 0, '<p><img _src="https://img.yzcdn.cn/upload_files/2018/05/11/FjCB0Cc5MVCFNy9NGER6rd4hDYcS.jpg!730x0.jpg" data-origin-height="10868" data-origin-width="750" src="https://img.yzcdn.cn/upload_files/2018/05/11/FjCB0Cc5MVCFNy9NGER6rd4hDYcS.jpg!730x0.jpg" /></p>\r\n\r\n<p><img _src="https://img.yzcdn.cn/upload_files/2017/07/25/Ftbd_qrRYt5NfOlgnxXARifnw5Qf.jpg!730x0.jpg" data-origin-height="1403" data-origin-width="1000" src="https://img.yzcdn.cn/upload_files/2017/07/25/Ftbd_qrRYt5NfOlgnxXARifnw5Qf.jpg!730x0.jpg" /></p>\r\n\r\n<p><strong><img _src="https://img.yzcdn.cn/upload_files/2017/02/15/FjDqRNdk1ldhrCJwmZ_2dXTkVtly.jpg!730x0.jpg" alt="" data-origin-height="160" data-origin-width="640" src="https://img.yzcdn.cn/upload_files/2017/02/15/FjDqRNdk1ldhrCJwmZ_2dXTkVtly.jpg!730x0.jpg" /></strong></p>\r\n\r\n<p><strong>商家承诺以下服务：&nbsp;&nbsp; &nbsp;</strong>&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>1、除港澳台、新疆西藏等偏远地外，其余地区默认韵达,圆通；</p>\r\n\r\n<p>2、商品本身无质量问题暂不支持7天无理由退换货。</p>\r\n', '["https:\\/\\/gggtwh.oss-cn-beijing.aliyuncs.com\\/2018\\/07\\/lWa1OeXPNIycvJE57ziCKktSpH4dTLxw.jpg","https:\\/\\/gggtwh.oss-cn-beijing.aliyuncs.com\\/2018\\/07\\/2XWaHlLMPeyktBFu4m0sohgSnENqQGcp.jpg","https:\\/\\/gggtwh.oss-cn-beijing.aliyuncs.com\\/2018\\/07\\/VB7ZSw0XIljd5bMFknsqu4UGiTmzJYOh.jpg","https:\\/\\/gggtwh.oss-cn-beijing.aliyuncs.com\\/2018\\/07\\/7weCmRrNBhld1FnXoLuJT5cgxiEfZ6A0.jpg"]', '[{"name":"规格","list":["紫禁星寰耳钉","紫禁星寰项链"]}]', '15.00', '2018-07-18 20:09:16', '2018-07-18 20:09:16', 'null'),
