(231, 235, 0, '<p><strong>明星爆款：2017年上架以来共计销售6000余套</strong></p>\r\n\r\n<p><strong>一个满含吉祥寓意的设计</strong></p>\r\n\r\n<p><strong>一次传统与时尚得完美结合</strong></p>\r\n\r\n<p><strong>一件每个细节都有故事可讲的美饰</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img _src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170204-1486200494132016178.jpg" alt="" src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170204-1486200494132016178.jpg" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>项链</strong>，又名胸前链、毛衣链。由蝙蝠，葫芦，祥云，钱币等6个元素组成，这些元素都是中国人熟悉并且喜欢的图案，虽然看似简单却每一个都是包含着对生活的美好期待和对未来的祝福。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img _src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170205-1486299541617012105.jpg" alt="" data-origin-height="2725" data-origin-width="2000" src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170205-1486299541617012105.jpg" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>寓意满满&nbsp;</strong></p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p>其中最主要灵感取自故宫中<strong>&nbsp;&quot;蝙蝠&quot;</strong>&nbsp;的吉祥寓意，选用红玛瑙来体现蝙蝠主体，故宫中常有红色蝙蝠纹饰，寓意&quot;鸿福齐天&quot;或&quot;鸿福无量&quot;，也象征着福比天高。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img _src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170205-1486299542230020268.png" alt="" data-origin-height="677" data-origin-width="497" src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170205-1486299542230020268.png" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>而在蝙蝠周边设计师又十分用心的选用祥云环绕，代表吉祥如意。并且蝙蝠的挂坠巧妙的设计，使得它可以随意取下，任意和其它元素搭配。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img _src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170205-1486299542923071624.png" alt="" data-origin-height="942" data-origin-width="687" src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170205-1486299542923071624.png" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>葫芦</strong>本来就有&quot;福禄&quot;之意，用蝙蝠挂坠与葫芦搭配，更表达了对于明年好福气的满满期待。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img _src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170205-1486299543657044223.jpg" alt="" data-origin-height="2959" data-origin-width="2362" src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170205-1486299543657044223.jpg" /></p>\r\n\r\n<p>图注：故宫博物院馆藏文物</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>祥云纹</strong>，极具中国文化的一个符号，更寓意祥瑞之云气,表达了吉祥、喜庆、幸福的愿望以及对生命的美好向往。当蝙蝠与祥云纹搭配，在画面上呈现一个类似&quot;8&quot;的图案，更是希望福气绵绵，来年发发！而另一层&quot;神马都是浮云&quot;的深意，更是现在年轻心态的一种传达。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img _src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170205-1486299544159011493.png" alt="" data-origin-height="497" data-origin-width="497" src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170205-1486299544159011493.png" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>古钱币</strong>（铜钱）的造型，除了有象征财富的意思，也寓意着福气在前；而其中方形白色母贝更是我们熟悉的天圆地方的意思。即使只是一个小小的元素都饱含多重寓意。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img _src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170205-1486299544635086004.png" alt="" data-origin-height="585" data-origin-width="577" src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170205-1486299544635086004.png" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>这些看似经常出现在书上的图案，这些中国人最喜欢的传统吉祥话，却经过设计师的巧妙设计和精心组合，用一条时尚的项链将所有祝福与对美好的期待通通串联在一起，让所有的元素随意的点缀在项链上，又用项链串连悬挂在胸前，形成一幅财富与吉祥的美图。也让传统与时尚碰撞出新的火花。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>项链十八变</strong></p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p>一条项链能有十八般武艺？没错，当设计像变魔术一般的把整条项链各种 &quot;拆开&quot; 重新组合，变化出18种不同的样子！跟紧小编的步伐，看看项链如何大变身</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>选择长项链佩戴方式非常的适合春秋的搭配，优雅又大气。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img _src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170205-1486300206551040594.jpg" alt="" data-origin-height="400" data-origin-width="640" src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170205-1486300206551040594.jpg" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>除了最基本的长项链的搭配，还可以通过双绕颈，组成双层的绕颈链子。再根据红色蝙蝠不同位置的搭配出不同的效果。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img _src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170205-1486300206912008222.jpg" alt="" data-origin-height="442" data-origin-width="1117" src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170205-1486300206912008222.jpg" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img _src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170205-1486299548063005901.gif" alt="" data-origin-height="200" data-origin-width="356" src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170205-1486299548063005901.gif" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>现在要重点给大家展示几种<strong>&nbsp;&quot;异形&quot;</strong>&nbsp;的戴法。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>1. 整体连接成一条长链子，把一头从葫芦的位置穿过，搭配着出一种随意感；</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>2. 以葫芦部分为主体，另一条项链作为一个长吊坠挂在葫芦处，非常有个性的一种戴法；</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>3. 以一条锁骨链为主题，用另一条项链悬挂在主体锁骨链之上，长项链可以分成两条锁骨链，再加上蝙蝠吊坠的不同位置的搭配，相比于长项链的搭配方式，锁骨链更加的年轻活泼。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img _src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170205-1486300207494046167.jpg" alt="" data-origin-height="442" data-origin-width="632" src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170205-1486300207494046167.jpg" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img _src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170205-1486299551239082260.gif" alt="" data-origin-height="200" data-origin-width="356" src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170205-1486299551239082260.gif" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>红色蝙蝠不仅是整个设计中的主体部分，在实用搭配上也是用尽心思，作为可以随意取下的一部分，它本身就是一个百搭且万能的吊坠，而且可以360旋转，举手投足间都能给你整体造型增加灵动性。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img _src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170205-1486300209120048396.jpg" alt="" data-origin-height="2223" data-origin-width="5044" src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170205-1486300209120048396.jpg" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img _src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170205-1486299551930042881.gif" alt="" data-origin-height="200" data-origin-width="320" src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170205-1486299551930042881.gif" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>可以搭配自己平时喜爱的手串，可以作为小小的胸针，可以佩戴任何地方，甚至可以作为项链后面的一个吊坠。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img _src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170205-1486300209391063306.jpg" alt="" data-origin-height="640" data-origin-width="640" src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170205-1486300209391063306.jpg" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>这18般变化的戴法都学会了么？还是你又有新的发现！一条项链还自带烧脑属性也是没sei了。快来带回家研究下！</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img _src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170204-1486200494132016178.jpg" alt="" src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170204-1486200494132016178.jpg" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>产品参数详情</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>▌<strong>项链长度</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>83CM+10CM延长链</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>▌<strong>各元素材质</strong></p>\r\n\r\n<p>圆形青金石、方形贝母、方形黑玛瑙</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>▌<strong>宝石及产地</strong></p>\r\n\r\n<p>国产优质天然白贝母，巴西产天然黑玛瑙、红玛瑙，阿富汗天然青金石、绿松石</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>▌<strong>材质</strong></p>\r\n\r\n<p>银镀金</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>▌<strong>多种戴法</strong></p>\r\n\r\n<p>多种场合佩戴，四季合宜。蝙蝠坠可360&deg;旋转，灵动，也可以取下扣在衬衫扣、毛衣扣等地方单戴，优雅可爱。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img _src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170204-1486200494132016178.jpg" alt="" src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170204-1486200494132016178.jpg" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>产品配件详情</strong></p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p>每一条项链都会有一个印有故宫文化珠宝的logo的防尘袋子，不用的时候可以把项链放置其中，给其最好的保护。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>项链配有精致可爱又复古的小锦囊单独包装。小锦囊中还做了贴心的分出了各层，让长项链放置其中的时候，不会缠绕打结。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img _src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170205-1486299558328007993.jpg" alt="" data-origin-height="1461" data-origin-width="1500" src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170205-1486299558328007993.jpg" /><img _src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170205-1486299558809005786.jpg" alt="" data-origin-height="1609" data-origin-width="1500" src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170205-1486299558809005786.jpg" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img _src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170204-1486200494132016178.jpg" alt="" src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170204-1486200494132016178.jpg" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>每一件珠宝产品都配备故宫权威机构出具的</strong></p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>《故宫收藏证书》</strong></p>\r\n\r\n<p><img _src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170205-1486299560735005119.png" alt="" data-origin-height="1110" data-origin-width="1500" src="http://7xo6kd.com1.z0.glb.clouddn.com/upload-ueditor-image-20170205-1486299560735005119.png" /></p>\r\n', '["https:\\/\\/gggtwh.oss-cn-beijing.aliyuncs.com\\/2018\\/07\\/zcKOV3BaUSxMirHG7Tshe2mNlyFtDnCW.jpg","https:\\/\\/gggtwh.oss-cn-beijing.aliyuncs.com\\/2018\\/07\\/tmAQs7XHiJ1TxD3rIFd0zL8caje542Wp.jpg","https:\\/\\/gggtwh.oss-cn-beijing.aliyuncs.com\\/2018\\/07\\/67Uzt5ToBgceyEGH0LRDlSVkZnI4va9d.jpg"]', '[]', '15.00', '2018-07-18 20:23:44', '2018-07-18 20:23:44', 'null'),
