(234, 238, 0, '<p>故宫文化珠宝x&nbsp;爱奇艺 &nbsp;推出联名款首饰&ldquo;福佑奇缘&rdquo;</p>\r\n\r\n<p>福气满满，祥瑞绕环</p>\r\n\r\n<p><img _src="https://img.yzcdn.cn/upload_files/2017/09/14/FvwWZBPrG0fVzJNo_0e4qb7GpD5f.jpg!730x0.jpg" data-origin-height="4593" data-origin-width="6500" src="https://img.yzcdn.cn/upload_files/2017/09/14/FvwWZBPrG0fVzJNo_0e4qb7GpD5f.jpg!730x0.jpg" /></p>\r\n\r\n<p><img _src="https://img.yzcdn.cn/upload_files/2017/09/14/FrAvp9ImKyfnOO7YsbxUfX2Aszt6.jpg!730x0.jpg" data-origin-height="3183" data-origin-width="6893" src="https://img.yzcdn.cn/upload_files/2017/09/14/FrAvp9ImKyfnOO7YsbxUfX2Aszt6.jpg!730x0.jpg" /></p>\r\n\r\n<p>福佑奇缘(925银镀18K金镶天然宝石项链)</p>\r\n\r\n<p>规格：0.75CM*40.5CM</p>\r\n\r\n<p>材质：925纯银镀18K黄金打造<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;镶嵌石榴石及绿色玛瑙</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>把故宫中一系列的吉祥元素和悦享生活的理念串联在一起，以不对称的设计演绎碰撞出全新的表现形式，不仅仅蕴含吉祥意义，同时也打破了传统的对称，更加营造出古今相融合却又不同的美感。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>蝙蝠：</p>\r\n\r\n<p><img _src="https://img.yzcdn.cn/upload_files/2017/08/22/Fm5H6GGpEO4T4W-FLbENEtUsMHsG.jpg!730x0.jpg" data-origin-height="640" data-origin-width="640" src="https://img.yzcdn.cn/upload_files/2017/08/22/Fm5H6GGpEO4T4W-FLbENEtUsMHsG.jpg!730x0.jpg" /></p>\r\n\r\n<p>在中国传统文化中，因&ldquo;蝠&rdquo;谐音&ldquo;福&rdquo;，所以蝙蝠是祥瑞的代表，常用来寓意福气、幸福等。蝙蝠的造型在我国传统装饰艺术中是一个创造，中国人用自己丰富的想象和大胆的变形手法，把原本蝙蝠的形象变得翅卷祥云、风度翩翩。</p>\r\n\r\n<p>此次这条锁骨链的蝙蝠灵感来源于根据故宫博物院藏文物&ldquo;松石绿地矾红彩云蝠纹葫芦瓶&rdquo;。</p>\r\n\r\n<p><img _src="https://img.yzcdn.cn/upload_files/2017/08/22/FiwBaKPK5aiqt7zxVf6YSc71DAxo.jpg!730x0.jpg" data-origin-height="527" data-origin-width="421" src="https://img.yzcdn.cn/upload_files/2017/08/22/FiwBaKPK5aiqt7zxVf6YSc71DAxo.jpg!730x0.jpg" /></p>\r\n\r\n<p>松石绿地矾红彩云蝠纹葫芦瓶，清乾隆，口径3.5cm，底径11.4cm，高33.3cm。<br />\r\n葫芦形瓶是中国古代陶瓷中的传统造型，葫芦的多籽与缠绕的藤蔓被人类赋予多子多孙和延绵不断繁衍的含义。葫芦也是道教的圣物，既是通往仙境的法物，也是存放金丹的容器。瓶上的&ldquo;红蝠&rdquo;与&ldquo;洪福&rdquo;谐音，寓意&ldquo;洪福齐天&rdquo;。<br />\r\n此瓶造型饱满端庄，无论是纹样还是造型均反映了乾隆时期对&ldquo;福文化&rdquo;的理解和追求</p>\r\n\r\n<p>而红色蝙蝠配以石榴石则是取意子孙延绵，用红石榴石，则是更添洪福齐天，洪福无量之意。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>铜钱：</p>\r\n\r\n<p><img _src="https://img.yzcdn.cn/upload_files/2017/08/22/FuZuJZluUpoIfwWQcuM2H-Oy78Yf.jpg!730x0.jpg" data-origin-height="640" data-origin-width="640" src="https://img.yzcdn.cn/upload_files/2017/08/22/FuZuJZluUpoIfwWQcuM2H-Oy78Yf.jpg!730x0.jpg" /></p>\r\n\r\n<p>铜钱的设计凸显着天圆地方的形态，圆为天之形、方为地之态，圆象征着平等、包容、和谐的道，方象征着尊卑有序、松紧有度、远近有别的理。</p>\r\n\r\n<p>蝙蝠与铜钱取意福在眼前，钱币代表&ldquo;禄&rdquo;，更有大富大贵。取代表着&ldquo;悦享生活&rdquo;的绿色玛瑙镶嵌则是体现了万物平衡，更体现悦享生活品质的理念。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>祥云</p>\r\n\r\n<p><img _src="https://img.yzcdn.cn/upload_files/2017/08/22/Fv6oFC48hik2MuSiT8qeK5639SJU.jpg!730x0.jpg" data-origin-height="640" data-origin-width="640" src="https://img.yzcdn.cn/upload_files/2017/08/22/Fv6oFC48hik2MuSiT8qeK5639SJU.jpg!730x0.jpg" /></p>\r\n\r\n<p>祥云是中国传统意义中最常见的吉祥元素。</p>\r\n\r\n<p>祥云的文化概念在中国具有上千年的时间跨度，是最具有代表性的中国文化符号之一，更有着&nbsp;&ldquo;渊源共生，和谐共融&rdquo;的意义。在古人看来，云是吉祥和高升的象征，是圣天的造物。&nbsp;祥云的图案在故宫中也是最广泛使用的吉祥元素之一，寓意吉祥如意，祥和万代。</p>\r\n\r\n<p><img _src="https://img.yzcdn.cn/upload_files/2017/08/31/Fko_bdTWQEhxc441QbyHAXOKT8qt.jpg!730x0.jpg" data-origin-height="5567" data-origin-width="8688" src="https://img.yzcdn.cn/upload_files/2017/08/31/Fko_bdTWQEhxc441QbyHAXOKT8qt.jpg!730x0.jpg" /></p>\r\n\r\n<p>以吉祥环绕，以传统充盈生活，</p>\r\n\r\n<p>悦享生活，享的是那些最有福气的事儿。</p>\r\n\r\n<p><img _src="https://img.yzcdn.cn/upload_files/2017/07/25/Ftbd_qrRYt5NfOlgnxXARifnw5Qf.jpg!730x0.jpg" data-origin-height="1403" data-origin-width="1000" src="https://img.yzcdn.cn/upload_files/2017/07/25/Ftbd_qrRYt5NfOlgnxXARifnw5Qf.jpg!730x0.jpg" /></p>\r\n\r\n<p><strong><img _src="https://img.yzcdn.cn/upload_files/2017/02/15/FjDqRNdk1ldhrCJwmZ_2dXTkVtly.jpg!730x0.jpg" data-origin-height="160" data-origin-width="640" src="https://img.yzcdn.cn/upload_files/2017/02/15/FjDqRNdk1ldhrCJwmZ_2dXTkVtly.jpg!730x0.jpg" /></strong></p>\r\n\r\n<p><strong>商家承诺以下服务：&nbsp;&nbsp; &nbsp;</strong>&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>1、除港澳台、新疆西藏等偏远地外，其余地区默认韵达,圆通；&nbsp;&nbsp;</p>\r\n\r\n<p>2、商品本身无质量问题暂不支持7天无理由退换货。</p>\r\n', '["https:\\/\\/gggtwh.oss-cn-beijing.aliyuncs.com\\/2018\\/07\\/ECwlIbRzx4OZkVvN627uLs5fd90FU8nm.jpg","https:\\/\\/gggtwh.oss-cn-beijing.aliyuncs.com\\/2018\\/07\\/LcqnxTepIWzrD6y7vdUgjsmV0QlFM39t.jpg"]', '[]', '15.00', '2018-07-18 22:53:44', '2018-07-18 22:53:44', 'null'),
